-- PLATFORMING

-- Platforms

function drawPlat (x, y, length)
	for  i=0, length, 1
		do
			mset(i+x, y, PLAT)
		end
end

function randLevel()

	offset = 0

	temp = math.random(3,8)

	offset = offset +2 + temp

	drawPlat (26 - offset , 5, temp)

	temp = math.random(3,8)

	offset = offset +2 + temp

	drawPlat (26 - offset , 7, temp)

	temp = 22 - offset

	drawPlat (5, 9, temp)
	
end

-- Cat Animation Functions
function catWalk(x, y)
	if(t%20>=10) then
		spr(WALK1, x, y, 0, 1, dir)
	else
		spr(WALK2, x, y, 0, 1, dir)
	end
end

function jumpAnim(x, y)
	if(t%60<=10) then
		spr(WALK1, x, y, 0, 1, dir)

	elseif(t%60<=20) then
		spr(CROUCH, x, y, 0,  1, dir)
	
	elseif(t%60<=30) then
		spr(UPANGLE, x, y, 0,  1, dir)
	
	elseif(t%60<=40) then
		spr(INAIR, x, y, 0,  1, dir)
	
	elseif(t%60<=50) then
		spr(DOWNANGLE, x, y, 0,  1, dir)
	
	else
		spr(WALK2, x, y, 0,  1, dir)
	end
end

-- Conditionals
function onPlatform()
	if (mget( ( (((catx)%240)/8) + MAPMOD),((((caty+8)%128))/8) ) == PLAT) then
		return true
	end
	if (mget( ( (((catx+4)%240)/8) + MAPMOD),((((caty+8)%128))/8) ) == PLAT) then
		return true
	end
	if (mget( ( (((catx+7)%240)/8) + MAPMOD),((((caty+8)%128))/8) ) == PLAT) then
		return true
	end
	return false
end

function headBonk()
	if (mget( ( (((catx)%240)/8) + MAPMOD),((((caty-1)%128))/8) ) == PLAT) then
		return true
	end
	if (mget( ( (((catx+4)%240)/8) + MAPMOD),((((caty-1)%128))/8) ) == PLAT) then
		return true
	end
	if (mget( ( (((catx+7)%240)/8) + MAPMOD),((((caty-1)%128))/8) ) == PLAT) then
		return true
	end
	return false
end

function catGoRight()  
	if (not (mget( ( (((catx + 8)%240)/8) + MAPMOD),((((caty)%128))/8) ) == PLAT)) then
		return true
	end

	if (not (mget( ( (((catx + 8)%240)/8) + MAPMOD),((((caty + 7)%128))/8) ) == PLAT)) then
		return true
	end

	return false
end

function catGoLeft()  
	if (not (mget( ( (((catx -1)%240)/8) + MAPMOD),((((caty)%128))/8) ) == PLAT)) then
		return true
	end

	if (not (mget( ( (((catx -1)%240)/8) + MAPMOD),((((caty+7)%128))/8) ) == PLAT)) then
		return true
	end

	return false
end

-- Physics Engine
catx = 8
caty = 32
catxvel = 0
catyvel = 0
catxacc = 0
catyacc = 0

ysl = 1
xsl = 1

fricCoeff = 0.15
gravityCoeff = 0.1

function updatePos()
	if (catyvel > ysl) then
		catyvel = ysl
	end
	if (catxvel > xsl) then
		catxvel = xsl
	elseif (catxvel < -xsl) then
		catxvel = -xsl
	end

	catx = catx + catxvel
	caty = caty + catyvel

	catxvel = catxvel + catxacc
	catyvel = catyvel + catyacc

	
end

function friction()
	if(not (catxvel == 0)) then
		if(catxvel>0) then -- if velocity is positive
			catxvel = catxvel - fricCoeff -- decrement
			if(catxvel<0) then -- if its negative
				catxvel = 0; -- now its zero
			end
		else -- if velocity is negative
			catxvel = catxvel + fricCoeff -- Increment
			if(catxvel>0) then -- if its positive
				catxvel = 0; -- now its zero
			end
		end
	end
end

function catGravity()
	if (not (onPlatform()) ) then
		catyacc = gravityCoeff
	else
		catyacc = 0
		catyvel = 0
	end
end

-- Controls
function moveConts()

	--Lateral Movement
	if(key(RIGHT)) then
		if(catGoRight()) then
			catxacc = 0.05
			dir = 0
		else
			catxacc = 0
			catxvel = 0
		end

	elseif(key(LEFT)) then
		if(catGoLeft()) then
			catxacc = -0.05
			dir = 1
		else
			catxacc = 0
			catxvel = 0
		end
	else
		catxacc = 0
		friction()
	end

	--Jump
	if((key(UP)) and (onPlatform())) then
		catyvel = -2
	end

	-- Concussions have meaning
	if (headBonk()) then
		caty = caty + 1
		catyvel = 0
	end

end

