function drawTet()
	map(30, 5, 1, 1, tetromino[0]*8, tetromino[1]*8)
	map(30, 5, 1, 1, tetromino[2]*8, tetromino[3]*8)
	map(30, 5, 1, 1, tetromino[4]*8, tetromino[5]*8)
	map(30, 5, 1, 1, tetromino[6]*8, tetromino[7]*8)
end

function land()
	
	if (mget(tetromino[0]+30,tetromino[1]+1) == PLAT) then
		return true
	end

	if (mget(tetromino[2]+30,tetromino[3]+1) == PLAT) then
		return true
	end

	if (mget(tetromino[4]+30,tetromino[5]+1) == PLAT) then
		return true
	end

	if (mget(tetromino[6]+30,tetromino[7]+1) == PLAT) then
		return true
	end

	return false

end

function canGoRight()
	
	if (mget(tetromino[0]+30+1,tetromino[1]) == PLAT) then
		return false
	end

	if (mget(tetromino[2]+30+1,tetromino[3]) == PLAT) then
		return false
	end

	if (mget(tetromino[4]+30+1,tetromino[5]+1) == PLAT) then
		return false
	end

	if (mget(tetromino[6]+30+1,tetromino[7]+1) == PLAT) then
		return false
	end

	return true
end

function canGoLeft()
	
	if (mget(tetromino[0]+30-1,tetromino[1]) == PLAT) then
		return false
	end

	if (mget(tetromino[2]+30-1,tetromino[3]) == PLAT) then
		return false
	end

	if (mget(tetromino[4]+30-1,tetromino[5]+1) == PLAT) then
		return false
	end

	if (mget(tetromino[6]+30-1,tetromino[7]+1) == PLAT) then
		return false
	end

	return true
end

function rotate()
	tempTet = {}

	for  i=0, 7, 1 do --if this causes problems change 7 to 7
		tempTet[i] = tetromino[i]
	end

	-- Set up a translation vector (centers piece at second block)
	transx = tetromino[2]
	transy = tetromino[3]

	-- Translate Each Block Towards (0,0)
	tempTet[0] = tempTet[0] - transx
	tempTet[1] = tempTet[1] - transy

	tempTet[2] = tempTet[2] - transx
	tempTet[3] = tempTet[3] - transy
	
	tempTet[4] = tempTet[4] - transx
	tempTet[5] = tempTet[5] - transy

	tempTet[6] = tempTet[6] - transx
	tempTet[7] = tempTet[7] - transy


	-- Apply Transformation Matrix For Each Block
	-- x coords
	tetromino[0] = -tempTet[1]
	tetromino[2] = -tempTet[3]
	tetromino[4] = -tempTet[5]
	tetromino[6] = -tempTet[7]	

	-- y coords
	tetromino[1] = tempTet[0]
	tetromino[3] = tempTet[2]
	tetromino[5] = tempTet[4]
	tetromino[7] = tempTet[6]

	-- Translate Each Block Back
	tetromino[0] = tetromino[0] + transx
	tetromino[1] = tetromino[1] + transy

	tetromino[2] = tetromino[2] + transx
	tetromino[3] = tetromino[3] + transy

	tetromino[4] = tetromino[4] + transx
	tetromino[5] = tetromino[5] + transy

	tetromino[6] = tetromino[6] + transx
	tetromino[7] = tetromino[7] + transy
	
end

function canRotate()
	tempTet1 = {}
	tempTet2 = {}

	for  i=0, 7, 1 do --if this causes problems change 7 to 7
		tempTet1[i] = tetromino[i]
		tempTet2[i] = tetromino[i]
	end

	-- Set up a translation vector (centers piece at second block)
	transx = tetromino[2]
	transy = tetromino[3]

	-- Translate Each Block Towards (0,0)
	tempTet1[0] = tempTet1[0] - transx
	tempTet1[1] = tempTet1[1] - transy

	tempTet1[2] = tempTet1[2] - transx
	tempTet1[3] = tempTet1[3] - transy
	
	tempTet1[4] = tempTet1[4] - transx
	tempTet1[5] = tempTet1[5] - transy

	tempTet1[6] = tempTet1[6] - transx
	tempTet1[7] = tempTet1[7] - transy


	-- Apply Transformation Matrix For Each Block
	-- x coords
	tempTet2[0] = -tempTet1[1]
	tempTet2[2] = -tempTet1[3]
	tempTet2[4] = -tempTet1[5]
	tempTet2[6] = -tempTet1[7]	

	-- y coords
	tempTet2[1] = tempTet1[0]
	tempTet2[3] = tempTet1[2]
	tempTet2[5] = tempTet1[4]
	tempTet2[7] = tempTet1[6]

	-- Translate Each Block Back
	tempTet2[0] = tempTet2[0] + transx
	tempTet2[1] = tempTet2[1] + transy

	tempTet2[2] = tempTet2[2] + transx
	tempTet2[3] = tempTet2[3] + transy

	tempTet2[4] = tempTet2[4] + transx
	tempTet2[5] = tempTet2[5] + transy

	tempTet2[6] = tempTet2[6] + transx
	tempTet2[7] = tempTet2[7] + transy

	if (mget(tempTet2[0]+30, tempTet2[1]) == PLAT) then
		return false
	end
	
	if (mget(tempTet2[2]+30, tempTet2[3]) == PLAT) then
		return false
	end

	if (mget(tempTet2[4]+30, tempTet2[5]) == PLAT) then
		return false
	end

	if (mget(tempTet2[6]+30, tempTet2[7]) == PLAT) then
		return false
	end

	return true
end

function fixTet()
	mset(tetromino[0]+30, tetromino[1], PLAT)
	mset(tetromino[2]+30, tetromino[3], PLAT)
	mset(tetromino[4]+30, tetromino[5], PLAT)
	mset(tetromino[6]+30, tetromino[7], PLAT)
end

function moveTet()
	--Lateral Movement
	if (t%4 == 0) then
		if(key(RIGHT) and canGoRight()) then
			tetromino[0] = tetromino [0] + 1
			tetromino[2] = tetromino [2] + 1
			tetromino[4] = tetromino [4] + 1
			tetromino[6] = tetromino [6] + 1
		end

		if(key(LEFT) and canGoLeft()) then
			tetromino[0] = tetromino [0] - 1
			tetromino[2] = tetromino [2] - 1
			tetromino[4] = tetromino [4] - 1
			tetromino[6] = tetromino [6] - 1
		end

		
	end
	
	if(key(DOWN)) then
		if (not land()) then
			-- Moves Tetromino  faster
			if ((t)%2 == 0) then
				for  i=1, 7, 2
				do
					tetromino[i]=tetromino[i]+1
				end
			end
		end
	end
	
	if (t%8 == 0) then
		if(key(UP) and canRotate() ) then
			rotate()
		end
		
	end
end

function tetGrav()
	if (not land()) then
		-- Moves Tetromino Down
		if (t%10 == 0) then
			for  i=1, 7, 2
			do
				tetromino[i]=tetromino[i]+1
			end
		end
	end
end

function tetTimer()
	--timer line
	line(0, 3, (240-(240*((t/60)/LEVELTIME))), 3, 0)
end

function playTetris() 
	moveTet()

	drawTet() -- Draws the Tetromino in its current place
			
	tetGrav() -- move down

	if (land()) then
		fixTet()
		resetLib()
		tetromino = tetLib[math.random(0,6)]
	end		
end

function fixBG()
	for x = 0, 29, 1
	do
		for y = 0, 14, 1
		do
			mset(x+MAPMOD,y, mget((x+MAPMOD+30),y))
		end
	end
end

function resetTetris()
	fixBG()
	t=-1
end

function handleModes()
	if (SCREENMODE == PLATFORM) then
		cls(13)
		map(0,0,30,17,0,0)
		print( SCREENSDRAWN, 8, 8, 1)

		CONTROLMODE = PLATFORM
		MAPMOD = 0

		--Stuff for drawing platforms
		
		if (LEVELDRAWN == 0) then
			randLevel()
			LEVELDRAWN = 1
		end
		-- drawPlat (6, 8, 5)
		
		-- drawPlat (12, 10, 8)

		-- drawPlat (15, 5, 10)
		
	end

	if (SCREENMODE == TETRIS) then
		cls(13)
		map(30,0,30,17,0,0)
		print( SCREENSDRAWN, 8, 8, 1)
		MAPMOD = 30

		if (t <= (LEVELTIME*60)) then
			catWalk(8,32) -- this is a placeholder for now
			catx = 8
			caty = 32

			CONTROLMODE = TETRIS
			tetTimer() -- Just Draws the line

			if (TetStart == 0) then
				tetromino = tetLib[3]	
				
				TetStart = 1
			end

			if (TetStart == 1) then
				playTetris()

			end
		else
			CONTROLMODE = PLATFORM

			if (key(SPACE)) then
				resetTetris()
			end
		end
	end

	if (CONTROLMODE == PLATFORM) then
		moveConts() -- Move controls for cat

		updatePos() -- Update Cat position

		catGravity() -- Simulate Gravity when cat is jumping

		jumpAnim((catx)%240, caty%128) -- Render cat with jump animation
		
	end

	if (CONTROLMODE == TETRIS) then
		
	end

	
	--cls(13)
	--spr(1+t%60//30*2,x,y,14,3,0,0,2,2)
	--print("HELLO WORLD!",84,84)
	if (SCREENMODE == SCREEN) then
		map(0, 119, 30,17,0,0)
		print("ABLOCKALYPSE", 50, 46, 4, true, 2)

		if ((t%100) < 80) then
			print("Press Space to Start", 80, 74, 2, true, 1, true)
		end

		if (not (((t/4)%152) == 0) ) then
			if(dir==0) then
				jumpAnim(40+(((t/4)%152)), 56)
				if (((t/4)%152)==151) then
					dir = 1
				end
				
			else
				jumpAnim(192 - (((t/4)%152)), 56)

				if (((t/4)%152)==151) then
					dir = 0
				end
			end
		end
	end
end

function switchPlatMode()
	if ((catx%240) > 230) then
		catx = 1
		SCREENSDRAWN = SCREENSDRAWN + 1
		fixBG()

		if (SCREENMODE == PLATFORM) then
			SCREENMODE = TETRIS
			t = -1
		elseif (SCREENMODE == TETRIS) then
			SCREENMODE = PLATFORM
			LEVELDRAWN = 0
		end

	end
end

function TIC()
	
	handleModes()
	
	if ((SCREENMODE == 0) and (key(SPACE))) then
		SCREENMODE = PLATFORM
		CONTROLMODE = PLATFORM
	end

	switchPlatMode()

	t=t+1
end

